#include <iostream>
#include <vector>

using namespace std;

class Solution {
public:
	string originalDigits(string s) {
		vector<int> a(10, 0);
		vector<int> alpha(128, 0);
		for (char c : s)
			alpha[c]++;
		a[0] = alpha['z'];
		a[2] = alpha['w'];
		a[4] = alpha['u'];
		a[6] = alpha['x'];
		a[8] = alpha['g'];
		a[3] = alpha['h'] - a[8];
		a[5] = alpha['f'] - a[4];
		a[7] = alpha['v'] - a[5];
		a[1] = alpha['o'] - a[0] - a[2] - a[4];
		a[9] = alpha['i'] - a[5] - a[6] - a[8];
		string ans;
		for (int i = 0; i < 10; i++) {
			if (a[i] > 0)
				ans += string(a[i], '0' + i);
		}
		return ans;
	}
};

class _Solution {
public:
	vector<string> num = {
		"zero", "one", "two", "three", "four", "five", "six", "seven", "eight", "nine"
	};
	vector<vector<int>> nnum;

	string originalDigits(string s) {
		vector<int> ca(27, 0);
		vector<int> ians;
		string ans;

		// nums preprocessing
		for (auto it : num) {
			vector<int> v;
			for (auto jt : it) {
				v.push_back(jt - 'a');
			}
			nnum.push_back(v);
		}

		// add count array
		for (auto it : s) {
			ca[it - 'a']++;
		}

		while (true) {

			for (int i = 0; i < 10; ++i) {
				bool isAllNumHas = true;
				for (auto jt : nnum[i]) {
					isAllNumHas &= (ca[jt] >= 1);
				}
				if (isAllNumHas == true) {
					ians.push_back(i);
					for (auto jt : nnum[i]) {
						ca[jt]--;
					}
				}
			}

			int cnt = 0;
			for (auto it : ca) {
				cnt += it;
			}
			if (cnt <= 0) break;
		}


		for (auto it : ians) ans.push_back(it + '0');
		return ans;
	}
};

